import React, { useState, useEffect } from 'react';
import axios from 'axios';

function highlightMatch(context, match) {
  if (!match) return context;
  const idx = context.toLowerCase().indexOf(match.toLowerCase());
  if (idx === -1) return context;
  return (
    <>
      {context.slice(0, idx)}
      <span style={{ background: '#ffe066', fontWeight: 'bold' }}>{context.slice(idx, idx + match.length)}</span>
      {context.slice(idx + match.length)}
    </>
  );
}

function RegexTestModal({ open, onClose, context, defaultPattern }) {
  const [pattern, setPattern] = useState(defaultPattern || '');
  const [result, setResult] = useState(null);
  const [loading, setLoading] = useState(false);

  const handleTest = async () => {
    setLoading(true);
    setResult(null);
    try {
      const resp = await fetch('http://localhost:8000/pattern-learning/test-regex', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ pattern, text: context, context_chars: 50 })
      });
      const data = await resp.json();
      setResult(data);
    } catch (e) {
      setResult({ matches: [], contexts: ['Error: ' + e.message] });
    }
    setLoading(false);
  };

  if (!open) return null;
  return (
    <div style={{ position: 'fixed', top: 0, left: 0, width: '100vw', height: '100vh', background: '#0008', zIndex: 1000, display: 'flex', alignItems: 'center', justifyContent: 'center' }}>
      <div style={{ background: '#fff', padding: 32, borderRadius: 12, minWidth: 400, maxWidth: 600 }}>
        <h3>Live Regex Tester</h3>
        <div style={{ marginBottom: 12 }}>
          <label>Regex Pattern:</label>
          <input value={pattern} onChange={e => setPattern(e.target.value)} style={{ width: '100%', fontFamily: 'monospace', fontSize: 16, marginTop: 4 }} />
        </div>
        <button onClick={handleTest} style={{ marginBottom: 16, background: '#6c47ff', color: '#fff', border: 'none', borderRadius: 6, padding: '8px 20px', fontWeight: 'bold', cursor: 'pointer' }} disabled={loading}>
          {loading ? 'Testing...' : 'Test Regex'}
        </button>
        {result && (
          <div>
            <div style={{ marginBottom: 8 }}><b>Matches:</b> {result.matches && result.matches.length > 0 ? result.matches.join(', ') : 'None'}</div>
            <div style={{ marginBottom: 8 }}><b>Context:</b></div>
            {result.contexts && result.contexts.map((ctx, i) => (
              <div key={i} style={{ background: '#f6f6f6', padding: 8, marginBottom: 4, borderRadius: 4 }}>
                {result.matches && result.matches[i] ? highlightMatch(ctx, result.matches[i]) : ctx}
              </div>
            ))}
          </div>
        )}
        <button onClick={onClose} style={{ marginTop: 16, background: '#eee', color: '#333', border: 'none', borderRadius: 6, padding: '8px 20px', fontWeight: 'bold', cursor: 'pointer' }}>Close</button>
      </div>
    </div>
  );
}

const PatternLearningFeedback = ({ serverUrl, caseId = "54820" }) => {
  const [stats, setStats] = useState(null);
  const [suggestions, setSuggestions] = useState([]);
  const [feedback, setFeedback] = useState({ extractionId: '', isCorrect: true, comments: '' });
  const [loading, setLoading] = useState(false);
  const [message, setMessage] = useState('');
  const [enhancedAnalysis, setEnhancedAnalysis] = useState(null);
  const [regexModal, setRegexModal] = useState({ open: false, context: '', pattern: '' });

  useEffect(() => {
    fetchEnhancedAnalysis();
    fetchStats();
    fetchSuggestions();
  }, [serverUrl, caseId]);

  const fetchEnhancedAnalysis = async () => {
    try {
      setLoading(true);
      const response = await axios.get(`${serverUrl}/enhanced-analysis/wi/${caseId}`);
      setEnhancedAnalysis(response.data.data);
    } catch (error) {
      console.error('Error fetching enhanced analysis:', error);
      setMessage('Error fetching enhanced analysis');
    } finally {
      setLoading(false);
    }
  };

  const fetchStats = async () => {
    try {
      const response = await axios.get(`${serverUrl}/enhanced-analysis/wi/${caseId}/learning-insights`);
      setStats(response.data.data.statistics);
    } catch (error) {
      console.error('Error fetching stats:', error);
      setMessage('Error fetching statistics');
    }
  };

  const fetchSuggestions = async () => {
    try {
      const response = await axios.get(`${serverUrl}/pattern-learning/suggestions`);
      setSuggestions(response.data.data);
    } catch (error) {
      console.error('Error fetching suggestions:', error);
    }
  };

  const submitFeedback = async () => {
    try {
      setLoading(true);
      await axios.post(`${serverUrl}/enhanced-analysis/wi/${caseId}/feedback`, feedback);
      setMessage('Feedback submitted successfully!');
      setFeedback({ extractionId: '', isCorrect: true, comments: '' });
      fetchStats(); // Refresh stats
    } catch (error) {
      console.error('Error submitting feedback:', error);
      setMessage('Error submitting feedback');
    } finally {
      setLoading(false);
    }
  };

  const toggleSuggestion = async (suggestionId, status) => {
    try {
      await axios.post(`${serverUrl}/pattern-learning/suggestions/${suggestionId}/toggle`, { status });
      fetchSuggestions(); // Refresh suggestions
      setMessage('Suggestion status updated!');
    } catch (error) {
      console.error('Error toggling suggestion:', error);
      setMessage('Error updating suggestion');
    }
  };

  const handleFeedback = (extractionId, isCorrect) => {
    setFeedback(f => ({ ...f, extractionId, isCorrect }));
    // TODO: Send feedback to backend
  };

  if (!enhancedAnalysis || !enhancedAnalysis.all_extractions) {
    return <div className="no-data">No enhanced analysis available</div>;
  }

  return (
    <div className="pattern-learning-dashboard">
      <h2> WI Pattern Learning Dashboard</h2>
      <p className="case-info">Case ID: {caseId}</p>

      {message && (
        <div className={`message ${message.includes('Error') ? 'error' : 'success'}`}>
          {message}
        </div>
      )}

      <div className="dashboard-grid">
        {/* Enhanced Analysis Panel */}
        <div className="panel analysis-panel">
          <h3> Enhanced WI Analysis</h3>
          {loading ? (
            <div className="loading">Loading enhanced analysis...</div>
          ) : enhancedAnalysis ? (
            <div className="analysis-content">
              <div className="analysis-summary">
                <h4>Analysis Summary</h4>
                <div className="summary-item">
                  <span>Files Processed:</span>
                  <span>{enhancedAnalysis.files_processed || 0}</span>
                </div>
                <div className="summary-item">
                  <span>Files Successful:</span>
                  <span>{enhancedAnalysis.files_successful || 0}</span>
                </div>
                <div className="summary-item">
                  <span>Overall Confidence:</span>
                  <span className="confidence-score">
                    {(enhancedAnalysis.overall_confidence * 100).toFixed(1)}%
                  </span>
                </div>
                <div className="summary-item">
                  <span>Total Extractions:</span>
                  <span>{enhancedAnalysis.total_extractions || 0}</span>
                </div>
              </div>

              {enhancedAnalysis.all_extractions && enhancedAnalysis.all_extractions.length > 0 && (
                <div className="extractions-list">
                  <h4>Extraction Results</h4>
                  <table style={{ width: '100%', borderCollapse: 'collapse', marginBottom: 24 }}>
                    <thead>
                      <tr style={{ background: '#f6f6f6' }}>
                        <th style={{ padding: 8, border: '1px solid #eee' }}>Field</th>
                        <th style={{ padding: 8, border: '1px solid #eee' }}>Extracted Value</th>
                        <th style={{ padding: 8, border: '1px solid #eee' }}>Regex Pattern</th>
                        <th style={{ padding: 8, border: '1px solid #eee' }}>Context</th>
                        <th style={{ padding: 8, border: '1px solid #eee' }}>Feedback</th>
                        <th style={{ padding: 8, border: '1px solid #eee' }}>Test Regex</th>
                      </tr>
                    </thead>
                    <tbody>
                      {enhancedAnalysis.all_extractions.map((ex, i) => (
                        <tr key={ex.extraction_id || i}>
                          <td style={{ padding: 8, border: '1px solid #eee' }}>{ex.field_name}</td>
                          <td style={{ padding: 8, border: '1px solid #eee' }}>{ex.extracted_value}</td>
                          <td style={{ padding: 8, border: '1px solid #eee', fontFamily: 'monospace', fontSize: 13 }}>{ex.pattern || ex.pattern_used || ''}</td>
                          <td style={{ padding: 8, border: '1px solid #eee', maxWidth: 300, minWidth: 200 }}>
                            {highlightMatch(ex.context_text || '', ex.extracted_value)}
                          </td>
                          <td style={{ padding: 8, border: '1px solid #eee' }}>
                            {feedback[ex.extraction_id] ? (
                              <span style={{ color: feedback[ex.extraction_id] === 'correct' ? 'green' : 'red', fontWeight: 'bold' }}>{feedback[ex.extraction_id]}</span>
                            ) : (
                              <>
                                <button onClick={() => handleFeedback(ex.extraction_id, true)} style={{ background: '#4caf50', color: '#fff', border: 'none', borderRadius: 4, padding: '4px 10px', marginRight: 4, cursor: 'pointer' }}>Correct</button>
                                <button onClick={() => handleFeedback(ex.extraction_id, false)} style={{ background: '#f44336', color: '#fff', border: 'none', borderRadius: 4, padding: '4px 10px', cursor: 'pointer' }}>Incorrect</button>
                              </>
                            )}
                          </td>
