              <label>Extraction ID:</label>
              <input
                type="text"
                value={feedback.extractionId}
                onChange={(e) => setFeedback({...feedback, extractionId: e.target.value})}
                placeholder="Enter extraction ID"
              />
            </div>
            <div className="form-group">
              <label>Was the extraction correct?</label>
              <select
                value={feedback.isCorrect}
                onChange={(e) => setFeedback({...feedback, isCorrect: e.target.value === 'true'})}
              >
                <option value="true">Yes</option>
                <option value="false">No</option>
              </select>
            </div>
            <div className="form-group">
              <label>Comments:</label>
              <textarea
                value={feedback.comments}
                onChange={(e) => setFeedback({...feedback, comments: e.target.value})}
                placeholder="Additional comments..."
                rows="3"
              />
            </div>
            <button 
              onClick={submitFeedback}
              disabled={loading || !feedback.extractionId}
              className="submit-btn"
            >
              {loading ? 'Submitting...' : 'Submit Feedback'}
            </button>
          </div>
        </div>

